const Form = () => {
    return (
        <div>
            <form>
                <h1>Create your own breed!</h1>
                <label htmlFor="breedName">Your breed's name: </label>
                <input type="text" name="breedName" autoComplete="off"/>
            </form>
        </div>
    )
}
